import React, { useEffect, useState } from "react";

function App() {
  const [msgq, setMsg] = useState("");

  useEffect(() => {
    fetch("http://localhost:8080/ServletWebProject/hello").then((res) => 
      {
        if (!res.ok) throw new Error("Server error!");
        return res.json(); // <-- yahan pe contentType zaroori hai
      }).then((data) => setMsg(data.msgq))
      .catch((err) => setMsg("Error: " + err.message));
  }, []);

  return (
    <div>
      <h1>React + Servlet Demo</h1>
      <p>Message from Servlet: {msgq}</p>
    </div>
  );
}

export default App;
